import React from 'react';
import ReactDOm from 'react-dom';
import './index.css';
import './Heading';
import Headings from './Heading';
import Paragraph from './Para';

ReactDOm.render(<>
    <Headings />
   <Paragraph />
   <ol>
     <li>Hitesh</li>
     <li>Mali</li>
     <li>Chauhan</li>
     <li>Hello </li>
   </ol>
</>, document.getElementById('root'))
